_asm_output_line:
	; Output a whole line of bytes to the display.
	; This code is very repetitive and is generated by a Python script.
	; It is destructive to the line data!
	;
	; Each bit is processed as such
	;   load _TRISB into W2
	;   rotate address left into carry
	;    (carry now contains the bit we are interested in.)
	;   set carry in W2<W0> (W0 = const 5)
	;   move W2 to _TRISB
	;   clear C (carry), bit 0, in SR 
	;    (also gives time for the latches to settle, as recommended
	;     in the datasheet.)
	;   output W1 to PORTB (W1 = const 31 or 1 << 5)
	; BEGIN
	; addr 0x900
	mov     0x900, WREG
	btss    W0, #0
	bclr    TRISB, #5
	bset    PORTB, #5
	bset    TRISB, #5
